    CREATE PROCEDURE [dbo].[spParts_CreateData]
	    @tableName NVARCHAR(50),
	    @name NVARCHAR(MAX),
	    @code NVARCHAR(MAX),
	    @brand NVARCHAR(MAX),
	    @unitPrice DECIMAL(10, 2)
    AS

BEGIN
    SET NOCOUNT ON;

    DECLARE @sql NVARCHAR(MAX);

    SET @sql = N'DELETE FROM ' + QUOTENAME(@tableName) + N' WHERE Id = @id';

    EXEC sp_executesql @sql, 
                       N'@id INT', 
                       @id;
END

CREATE PROCEDURE [dbo].[spParts_ReadData]
    @SearchString NVARCHAR(50) = NULL,
    @Category NVARCHAR(50) = NULL,
    @Brand NVARCHAR(50) = NULL,
    @MinPrice DECIMAL(10, 2) = NULL,
    @MaxPrice DECIMAL(10, 2) = NULL
AS

BEGIN
    SET NOCOUNT ON;
    DECLARE @sql NVARCHAR(MAX);

    SET @sql = N'UPDATE ' + QUOTENAME(@tableName) + N' SET Name = @name, Code = @code, Brand = @brand, UnitPrice = @unitPrice ' +
               N'WHERE Id = @id';

    EXEC sp_executesql @sql, 
                       N'@id INT, @name NVARCHAR(MAX), @code NVARCHAR(MAX), @brand NVARCHAR(MAX), @unitPrice DECIMAL(10, 2)', 
                       @id, @name, @code, @brand, @unitPrice;
END

